        #region Public Methods

        public override void OnSearch()
        {
            if (tabControlSearch.SelectedTab == tpgSuchen)
            {
                foreach (Control ctl in UtilsGui.AllControls(tpgSuchen))
                {
                    if (ctl is KissButtonEdit)
                    {
                        ((KissButtonEdit)ctl).CheckPendingSearchValue();
                    }
                }
            }

            base.OnSearch();
        }

        #endregion

        #region Protected Methods

        protected override void NewSearch()
        {
            base.NewSearch();

            // ComboBox mit den letzten 12 Monaten abfüllen
            edtSucheDatumVon.LoadQuery(DBUtil.OpenSQL(@"
                declare @Current datetime
                Set @Current = dbo.fnFirstDayOf(getdate())
                Set @Current = dateadd(m,-1,@Current) -- Vormonat

                select Code = @Current, Text = dbo.fnXKurzMonatJahr(@Current) union all
                select Code = dateadd(m,-1,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-1,@Current)) union all
                select Code = dateadd(m,-2,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-2,@Current)) union all
                select Code = dateadd(m,-3,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-3,@Current)) union all
                select Code = dateadd(m,-4,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-4,@Current)) union all
                select Code = dateadd(m,-5,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-5,@Current)) union all
                select Code = dateadd(m,-6,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-6,@Current)) union all
                select Code = dateadd(m,-7,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-7,@Current)) union all
                select Code = dateadd(m,-8,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-8,@Current)) union all
                select Code = dateadd(m,-9,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-9,@Current)) union all
                select Code = dateadd(m,-10,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-10,@Current)) union all
                select Code = dateadd(m,-11,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-11,@Current)) union all
                select Code = dateadd(m,-12,@Current), Text = dbo.fnXKurzMonatJahr(dateadd(m,-12,@Current))"));

            // Vormonat berechnen
            DateTime dtDatum = DateTime.Now;
            int iMonat = dtDatum.Month;
            int iJahr = dtDatum.Year;
            dtDatum = DateTime.ParseExact(iJahr.ToString("0000") + iMonat.ToString("00") + "01", "yyyyMMdd", null);
            dtDatum = dtDatum.AddMonths(-1);

            // In KissLookUpEdit auswählen
            edtSucheDatumVon.EditValue = dtDatum;
        }

        protected override void RunSearch()
        {
            base.RunSearch();
        }

        #endregion
